import React, { useEffect, useState } from "react";
import './List.css';
import CardItem2 from './CardItemMenu';
import axios from "axios";

export default function List() {

  const [data, setData] = useState([]);
  
  useEffect(() => {
    axios
        .get('http://127.0.0.1:8000/api/v1/internship')
        .then((res) => {
            console.log(res.data);
            setData(res.data);
            
        })
        .catch((err) => {
            console.log(err);
        }); 
}, []);


  return (
    <section className="section-card2">
    <div className='card2'>

      <h1><span>GunMA  </span>Advantages </h1>

      { data.map(data=>
      <div className='card2__container'>
        <div className='card2__wrapper'>
          <ul className='card2__items'>
            <CardItem2
              src='images/detail3.png'
              text='With the detail information feature, users can see information from the company along with clear requirements, so that users can prepare ahead of time.'
              label='View Internship Information in Detail'
              path='/'
            />
         
          </ul>
         
         
       
        </div>

      </div>
      )}
    </div>
    </section>
  );
}
